import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import NavTabs from "./components/NavTabs";
import Home from "./components/pages/Home";
import About from "./components/pages/About";
import Blog from "./components/pages/Blog";
import Contact from "./components/pages/Contact";
import Random from "./components/pages/Random"

function App() {
  return (
    <Router>
      <div>
        <NavTabs />         {/** this is the reference to the navagation bar  **/}
        <Route exact path="/" component={Home} />            {/** similear to app.get, component{Home} will search the component file **/}
        <Route exact path="/about" component={About} />
        <Route exact path="/blog" component={Blog} />
        <Route path="/contact" component={Contact} />
        <Route path="/random1" component={Random} />       {/** the path must match whatevers in the navtabs.js file **/}
      </div>
    </Router>
  );
}

export default App;
